        return(
            <div>
                <div id="product-top">
                    <div id="product-desc">
                        <h1>{props.name}</h1>
                        <a><strong>Rs 249/-</strong></a>
                        <p>{props.description}</p>
                        <img src={Rating} />
                        <button>Add to cart</button> 
                    </div>

                    <div id="product-image">
                        <img src={props.img} />
                        <div id="more-images">
                            <div className="more-images"></div>
                            <div className="more-images"></div>
                        </div>
                    </div>
            </div>
            </div>

        )
    }

// aaaaaaaaaaaaaaaaaaaaa

function BannerData(props){
    if(i==0){
        return(
            <div id="banner">
            <div className="end"></div>

               <div id="banner-text">
               <a>{props.name}</a>
                <p>{props.description}</p>
                </div> 

                <div id="banner-img"  onClick={ProductDescription}>
                    <img src={props.img} />
                </div>

                <div className="slider" onClick={Right}><img src={right} /></div>   

