    }
    else if(i==Display.length-1){
        return(
            <div id="banner">

                <div className="slider" onClick={Left}><img src={left} /></div>

               <div id="banner-text">
               <a>{props.name}</a>
                <p>{props.description}</p>
                </div> 

                <div id="banner-img"  onClick={ProductDescription}>
                    <img src={props.img} />
                </div> 

              <div className="end"></div>     
            </div>
        )
    }
    else{
        return(
            <div id="banner">

                <div className="slider" onClick={Left}><img src={left} /></div>

               <div id="banner-text">
               <a>{props.name}</a>
                <p>{props.description}</p>
                </div> 

                <div id="banner-img"  onClick={ProductDescription}>
                    <img src={props.img} />
                </div>

                <div className="slider" onClick={Right}><img src={right} /></div>

            </div>
        )
    }

}

   return(
    <div>
         {productDisplay}
    </div>
   )
}      










